import "./Card.css";
import { StoreContext } from "../../../Context/StoreContext";

const Card = () => {
  const { cardItems, food_list, removeFromCard } = useContext(StoreContext);
  return (
    <div className="cart">
      <div className="card-items">
        <div className="card-items-title">
          <p>Items</p>
          <p>Title</p>
          <p>Price</p>
          <p>Quantity</p>
          <p>Total</p>
          <p>Remove</p>
        </div>
        <br />
        <hr />
        {food_list.map((item, index) => {
          if (<cardItems>item._id</cardItems>> 1) {
            return (
              <div className="card-items-title card-items-item">
                {/* <img src={item.image} alt="" /> */}
                <p>{item.name}</p>
                {/* <p>{item.price}</p>
                <p>{cardItems[item._id]}</p>
                <p>{item.price * cardItems[item._id]}</p>
                <p>x</p> */}
              </div>
            );
          }
        })}
      </div>
    </div>
  );
};

export default Card;
